import React, { Component } from 'react';
import Slider from "react-slick";
import "./slider.scss";
import { yieldExpression } from '@babel/types';


class My_Slider extends Component {
    state = {}
    render() {
        let slidersettings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1,
            fade: true,
            autoplay: true,
        };
        return (
            <>
                <Slider {...slidersettings}>
                    <div className="slider">
                        <div cllassName="item" style={{ backgroundImage: "./photos/photo_1.jpg" }}>
                        </div>
                    </div>


                    <div cllassName="item" style={{ backgroundImage: `url(./photos/photo_2.jpg)` }}>
                    </div>



                    <div cllassName="item" style={{ backgroundImage: `url(./photos/photo_3.jpg)` }}>
                    </div>



                    <div cllassName="item" style={{ backgroundImage: `url(./photos/photo_4.jpg)` }}>
                    </div>



                    <div cllassName="item" style={{ backgroundImage: `url(./photos/photo_5.jpg)` }}>
                    </div>




                </Slider>
            </>
        );
    }
}

export default My_Slider;
